// LearningNotes.js
// 학습노트 페이지
import React from 'react';

const LearningNotes = () => {
  return (
    <div className="learning-notes">
      <h1>학습노트 페이지</h1>
      <p>여기에 학습 노트 관련 콘텐츠를 추가</p>
    </div>
  );
};

export default LearningNotes;
